// Import
import React, { useState, useEffect} from "react";
import { useNavigate, useOutletContext, Link, useParams } from "react-router-dom";

// Functional Component
const BentleyDetail = () => {
    const { bentleyState: [bentley, setBentley] } = useOutletContext();
    const navigate = useNavigate();
    const {carId} = useParams();
    const [localBentley, setLocalBentley] = useState({});

    // fetchBentleyDetail
    useEffect (() => {
        console.log("BID", carId)
        async function fetchBentleyDetail(){
            // Fetch;
            try{
                const response = await fetch (`https://car-haven-back.onrender.com/api/bentley/${carId}`,{
                    headers: {
                        'Content-Type' : 'application/json'
                    }
                })
                // Translate the promise data;
                console.log("Response:", response)
                const car = await response.json();
                console.log("Here is translated Json:", car)
                setLocalBentley(car)
            } catch (error)
                {console.error(error)}
            // Set the State
        }
        fetchBentleyDetail()
    }, [])

    // Return
    return(
        <div className="more-detail">
            <div id="car-detail">
                {/* year */}
                {
                    localBentley.year ?
                    <p id="recipe-detail-description">{localBentley.year}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* Make */}
                {
                    localBentley.make ?
                    <p id="recipe-detail-name">{localBentley.make}</p>:
                    <p>Name can not be viewed</p>
                }

                {/* Model */}
                {
                    localBentley.model ?
                    <p id="recipe-detail-description">{localBentley.model}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* Price */}
                {
                    localBentley.price ?
                    <p id="recipe-detail-description">{localBentley.price}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* Description */}
                {
                    localBentley.description ?
                    <p id="recipe-detail-description">{localBentley.description}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* vin */}
                {
                    localBentley.vin ?
                    <p id="recipe-detail-description">{localBentley.vin}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* Mileage */}
                {
                    localBentley.mileage ?
                    <p id="recipe-detail-description">{localBentley.mileage}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* BodyType */}
                {
                    localBentley.bodyType ?
                    <p id="recipe-detail-description">{localBentley.bodyType}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* BodyType */}
                {
                    localBentley.exteriorColor ?
                    <p id="recipe-detail-description">{localBentley.exteriorColor}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* Interior Color */}
                {
                    localBentley.interiorColor ?
                    <p id="recipe-detail-description">{localBentley.interiorColor}</p>:
                    <p>Description can not be viewed</p>
                }

                {/* Doors */}
                {
                    localBentley.doors ?
                    <p id="recipe-detail-description">{localBentley.doors}</p>:
                    <p>Description can not be viewed</p>
                }
            </div>
            <div id="Car-images">
                {/* Images */}
                {
                    localBentley.imageOne ?
                    <img src={localBentley.imageOne} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageTwo ?
                    <img src={localBentley.imaget} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageThree ?
                    <img src={localBentley.imageThree} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageFour ?
                    <img src={localBentley.imageFour} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageFive ?
                    <img src={localBentley.imageFive} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageSix ?
                    <img src={localBentley.imageSix} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageSeven ?
                    <img src={localBentley.imageSeven} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
                {
                    localBentley.imageEight ?
                    <img src={localBentley.imageEight} id="recipe-detail-image"></img>:
                    <p>Image can not be viewed</p>
                }
            </div>

            {/* Go Back Button */}
            <button onClick={() => navigate(-1)} id="go-back-button">Back</button>
        </div>
    )
};

// Export
export default BentleyDetail;
